  describe('Event Idempotency', () => {
    it('should skip processing duplicate events', async () => {
      const mockSubscription = createMockStripeSubscription({
        id: 'sub_test123'
      })

      const event: Stripe.Event = {
        id: 'evt_duplicate123',
        object: 'event',
        created: Math.floor(Date.now() / 1000),
        type: 'customer.subscription.created',
        data: {
          object: mockSubscription as any,
          previous_attributes: {}
        },
        api_version: '2024-06-20',
        livemode: false,
        pending_webhooks: 1,
        request: {
          id: 'req_test123',
          idempotency_key: null
        }
      }

      // Process event first time
      await webhookService.handleWebhookEvent(event)
      expect(mockBillingService.syncSubscriptionFromStripe).toHaveBeenCalledTimes(1)

      // Process same event again (should be skipped)
      await webhookService.handleWebhookEvent(event)
      expect(mockBillingService.syncSubscriptionFromStripe).toHaveBeenCalledTimes(1)
    })

    it('should clean up old event IDs to prevent memory leak', async () => {
      const webhookServiceInstance = webhookService as any

      // Fill up processed events set
      for (let i = 0; i < 10001; i++) {
        webhookServiceInstance.processedEvents.add(`evt_${i}`)
      }

      expect(webhookServiceInstance.processedEvents.size).toBe(10001)

      const mockSubscription = createMockStripeSubscription()
      const event: Stripe.Event = {
        id: 'evt_cleanup_trigger',
        object: 'event',
        created: Math.floor(Date.now() / 1000),
        type: 'customer.subscription.created',
        data: {
          object: mockSubscription as any,
          previous_attributes: {}
        },
        api_version: '2024-06-20',
        livemode: false,
        pending_webhooks: 1,
        request: {
          id: 'req_test123',
          idempotency_key: null
